const Items =  ({product_id,product_name,mrp}) =>{
    return (
   
        <div className='row'>
        <div className='card m-3'>
            <div className='card-header'>
              {product_name}
            </div>
            <div className='card-body'>
              {mrp} <br/>
              <button type="button" className="btn btn-primary">click</button>
            </div>
          </div>
        </div>
     
    )
}

export default Items;
